import axios from 'axios';

export const fetchCharacter = async () => {
  const { data } = await axios.get('https://swapi.py4e.com/api/people/1/');
  if (data) {
    return data;
  }
};

export const getSpeciesName = async (url) => {
  const { data } = await axios.get(url);
  if (data && data.name) {
    return data;
  }
};

export const getFilmName = async (urls) => {
  const films = await axios.all(urls.map((url) => axios.get(url)));
  const filmNames = films.map((film) => {
    return film.data;
  });

  console.log('aaaa', films);
};
